import React, { useState, useEffect } from 'react';
import Modal from './Modal';

const DB_Modal = ({ showModal, onCloseModal, URL, setShowInput, setHostileInfo, setPlaneData, setIsPlane, setSaved}) => {
    
    return (
        <Modal isOpen={showModal} onClose={onCloseModal} URL={URL} setShowInput={setShowInput} 
        setHostileInfo={setHostileInfo} setPlaneData={setPlaneData} setIsPlane={setIsPlane}
        setSaved = {setSaved}/>
    );
};

export default DB_Modal;
